import Item from './components/Item/Item';
import Card from './components/Card';

const App = () => {
  return (
    <div className="App">
      <h1>Minha segunda criação com React</h1>
      <ul>
        <Item>Item 1 = Notbook </Item>
        <Item>Item 2 = Smartphone</Item>
        <Item>Item 3 = Relógio </Item>
        <Item>Item </Item>

      </ul>
      <Card />
    </div>
  );
}
export default App;

